/DisableStartupDialogs
— отключает вызов стартового диалога и диалогов аутентификации. При этом:

если командной строки недостаточно для выбора информационной базы или определения режима запуска, выдается ошибка; 
если командной строки недостаточно для авторизации пользователя в информационной базе, выдается ошибка; 
если в командной строке отсутствует авторизация в хранилище конфигурации, конфигуратор запускается без связи с хранилищем; 
если в командной строке ошибочная авторизация в хранилище конфигурации, выдается ошибка.

/DisableStartupMessages
— отключает стартовые сообщения: 

"Конфигурация базы данных не соответствует сохраненной конфигурации. Продолжить?"; 
"Возможностей Вашего компьютера недостаточно для редактирования справки по конфигурации. Для редактирования справки необходимо установить Microsoft Internet Explorer версии 6.0 или выше."; 
"Возможностей Вашего компьютера недостаточно для редактирования html-документов, в том числе разделов справки. Для редактирования html-документов необходимо установить Microsoft Internet Explorer версии 6.0 или выше. В данном запуске редактирование html-документов будет недоступно.".

/TComp [-None | -Deflate | -SDC]
— устанавливает режим сжатия трафика между сервером и клиентом (только для тонкого клиента). 

-None — сжатие отключено;
-Deflate — используется стандартное http сжатие трафика по алгоритму deflate;
-SDC — используется собственный алгоритм сжатия;
По умолчанию используется SDC-сжатие трафика.

/RunModeManagedApplication
— запуск толстого клиента в режиме управляемого приложения, при этом учитывается настройка в списке информационных баз:

"Выбирать автоматически" — запускается тонкий клиент; 
"Тонкий клиент" — запускается тонкий клиент; 
"Веб-клиент" — запускается веб-клиент; 
"Толстый клиент" — запускается толстый клиент в режиме управляемого приложения.
При этом, при запуске клиента отключается механизм автоматического подбора клиентского приложения.

/IBConnectionString <строка соединения>
— позволяет задать строку соединения с информационной базой целиком в том виде, в котором ее возвращает функция СтрокаСоединенияИнформационнойБазы(). Части строки соединения могут быть переопределены параметрами /S и /F. Для этого нужно, чтобы /IBConnectionString находился в командной строке раньше них. Передавая строку соединения в качестве параметра командной строки, нужно помнить о том, что строка соединения содержит кавычки. Поэтому требуется взять всю строку в кавычки, а содержащиеся внутри кавычки удвоить.

Дополнительные параметры строки соединения в режиме тонкого клиента:

wsn — имя пользователя для аутентификации на веб-сервере;
wsp — пароль пользователя для аутентификации на веб-сервере;
wspauto — использовать автоматические настройки прокси сервера;
wspsrv — адрес прокси сервера;
wspport — порт прокси;
wspuser — имя пользователя для прокси с авторизацией;
wsppwd — пароль для прокси с авторизацией.

/SLev<Уровень>
— определяет уровень защищенности соединения клиента с сервером "1С:Предприятия" (используется для тонкого и веб-клиентов в режиме "1С:Предприятие").

Параметр <Уровень> может принимать следующие значения:
   0 — незащищенное соединение;
   1 — защищенное соединение только в процессе выполнения аутентификации;
   2 — защищенное соединение в течение всего сеанса;
Если не указан, используется значение 0.
